import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='cabecera row'>
                    <div className='logo'>
                        Hola
                    </div>
                    <div className='opciones'>text-align: center;</div>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }
                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    border: solid 1px;
                }     


                .cabecera .logo{
                    width: 10%;
                    border: solid 1px;

                }

                .cabecera .opciones{
                    width: 90%;
                    border: solid 1px;  
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
